// src/components/Home.jsx

import React from 'react';
import { Link } from 'react-router-dom';

export default function Home() {
  // 1) Paste your Base64‐encoded SVG (no “data:image/…” prefix)
  const jobHuntSvgBase64 = `
    
  `.trim();

  // 2) Build a proper data URI
  const jobHuntDataUri = `data:image/svg+xml;base64,${jobHuntSvgBase64}`;

  return (
    <div className="home-page">
      {/* HERO */}
      <section className="hero">
        <div className="hero-content">
          <h1>Welcome to AI Job Recommendation</h1>
          <p>Your one‑stop platform for tailored job matches, 24/7 AI mentorship and market insights.</p>
          <Link to="/recommendations" className="btn-primary">
            Get Started
          </Link>
        </div>
        <div className="hero-graphic">
          {/* 3) Use the data URI as src */}
          <img
            src={jobHuntDataUri}
            alt="Job search illustration"
            className="hero-illustration"
          />
        </div>
      </section>

      {/* FEATURES */}
      <section className="features">
        <div className="feature-card">
          <img
            src="https://cdn.jsdelivr.net/npm/heroicons@2.0.13/24/outline/magnifying-glass.svg"
            alt="Search icon"
            className="feature-icon"
          />
          <h3>Smart Recommendations</h3>
          <p>AI‑driven job matches based on your skills, preferences and career goals.</p>
        </div>
        <div className="feature-card">
          <img
            src="https://cdn.jsdelivr.net/npm/heroicons@2.0.13/24/outline/chat-bubble-left-right.svg"
            alt="Chat icon"
            className="feature-icon"
          />
          <h3>On‑Demand Mentorship</h3>
          <p>Chat with our AI mentor to refine your resume, prep for interviews, and more.</p>
        </div>
        <div className="feature-card">
          <img
            src="https://cdn.jsdelivr.net/npm/heroicons@2.0.13/24/outline/chart-bar.svg"
            alt="Trends icon"
            className="feature-icon"
          />
          <h3>Market Trends</h3>
          <p>Stay ahead with real‑time insights into industry growth areas and in‑demand skills.</p>
        </div>
      </section>

      {/* CALL TO ACTION */}
      <section className="calltoaction">
        <h2>Ready to transform your job search?</h2>
        <Link to="/career-tips" className="btn-secondary">
          Explore Career Tips
        </Link>
      </section>
    </div>
  );
}
